    return (
        <>
            <CounterResult />
            <CounterButton step={2} calcType="+" actionCreator={add}/>
            <CounterButton step={2} calcType="-" actionCreator={minus}/>
            <CounterButton step={10} calcType="+" actionCreator={addAsync}/>
        </>
    )
}
export default Counter;
